import Despesas from './components/Despesas'
import Fornecedores from './components/Fornecedores'
import Pagamento from './components/Pagamento'
import Categorias from './components/Categorias'
import CreateDespesas from './components/CreateDespesa'
import Grid from '@mui/material/Grid';
import { Container, createTheme, ThemeProvider, GlobalStyles } from '@mui/material';
import Stack from '@mui/material/Stack';

const theme = createTheme({
  palette: {
    primary: {
      main: '#010440',
    },
    secondary: {
      main: '#D90D32'
    }
  }
})


const App = () => {
	return (
    <ThemeProvider theme={theme}>
      <GlobalStyles
          styles={{
            body: { backgroundColor: '#F2EADF'},
          }}
        />
		<div className="container">
      <Grid
        container
        direction="row"
        justifyContent="center"
        alignItems="flex-start"
      >
        <h1>Controle de despesas - Mercadinho</h1><br/>
      </Grid>
        <Stack spacing={2} sx={{ pb: 3 }} direction="row" justifyContent="center" alignItems="flex-start">
          <CreateDespesas />
        </Stack>
        <Container sx={{ width: '75%' }}>
        <Despesas />
      </Container>
		</div>
    </ThemeProvider>
	)
}

export default App
